import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, TextInput, Button, TouchableOpacity } from 'react-native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';


export default function xacnhandonhang({ navigation }) {
    return (
        <View style={styles.container}>
            <View style={styles.thanhtren}>
                <TouchableOpacity onPress={() => navigation.navigate('goback')}>
                    <Ionicons name="chevron-back" size={24} color="black" />
                </TouchableOpacity>
                <View style={styles.text}>
                    <Text style={styles.text}>XÁC NHẬN ĐƠN HÀNG</Text>
                </View>
            </View>
            <View style={{ width: 400, height: 1, marginTop: 30, marginLeft: -270, backgroundColor: 'black' }} />
                <Text> 3. Phương thức thanh toán</Text>
        </View>
    );
}

const Stack = createNativeStackNavigator();

const styles = StyleSheet.create({
    
    text: {
        marginLeft: 45,
        marginTop: 2,
    },
    thanhtren: {
        flexDirection: 'row',
        flex: 1,
      
        marginTop:30,
    },

})
